create table Pony_Rltn (
	Source_Pony_Id INT,
	Targer_Pony_Id INT,
	Relationship_Type VARCHAR(7),
	Intensity INT
);

-- after creation delete duplicate relations ( between same pair of source_pony_id, target_pony_id)
delete from pony_rltn
where rowid not in (
	select rowid from (
		select   rowid, source_pony_id, target_pony_id, max(intensity)
				 from    pony_rltn
				 group by source_pony_id, target_pony_id
				 order by source_pony_id, target_pony_id));